import React, { Component } from "react";
import { Link } from "react-router-dom";
import { AppBar, Toolbar, Button } from "@material-ui/core";


class Navbar extends Component {



    render() {
        const style = {
            Login: { marginRight: 0 }
        }

        return (
            <AppBar>
                <Toolbar>

                    <Button>Login</Button>
                </Toolbar>
            </AppBar>
        );
    }
}

export default Navbar;
